describe("Public Method Tests",function(){var b,a="Calling context element does not have instance of Slider bound to it. Check your code to make sure the JQuery object returned from the call to the slider() initializer is calling the method";describe("slider constructor",function(){it("reads and sets the 'id' attribute of the slider instance that is created",function(){var c="mySlider";b=$("#testSlider1").slider({id:c});var d=$("#testSlider1").parent("div.slider").is("#"+c);expect(d).toBeTruthy()});it("generates multiple slider instances from selector",function(){$(".makeSlider").slider();var c=$(".makeSlider").parent().is(".slider");expect(c).toBeTruthy();var d=$(".makeSlider").parent(".slider").length;expect(d).toEqual(2)});it("reads and sets the 'min' option properly",function(){var c=-5;b=$("#testSlider1").slider({min:c});b.slider("setValue",c);var d=b.slider("getValue");expect(d).toBe(c)});it("reads and sets the 'max' option properly",function(){var d=15;b=$("#testSlider1").slider({max:d});b.slider("setValue",d);var c=b.slider("getValue");expect(c).toBe(d)});describe("reads and sets the 'step' option properly",function(){expect(true).toBeTruthy()});it("reads and sets the 'precision' option properly",function(){b=$("#testSlider1").slider({precision:2});b.slider("setValue",8.115);var c=b.slider("getValue");expect(c).toBe(8.12)});it("reads and sets the 'orientation' option properly",function(){var d="vertical";b=$("#testSlider1").slider({orientation:d});var c=$("#testSlider1").parent("div.slider").hasClass("slider-vertical");expect(c).toBeTruthy()});it("reads and sets the 'value' option properly",function(){var d=8;b=$("#testSlider1").slider({value:d});b.slider("setValue",d);var c=b.slider("getValue");expect(c).toBe(d)});it("reads and sets the 'selection' option properly",function(){var d="after",e=10;b=$("#testSlider1").slider({selection:d});b.slider("setValue",e);var c=$("#testSlider1").siblings("div.slider-track").children("div.slider-selection").width();expect(c).toBe(0)});it("reads and sets the 'handle' option properly",function(){var c="triangle";b=$("#testSlider1").slider({handle:c});var d=$("#testSlider1").siblings("div.slider-track").children("div.slider-handle").hasClass("triangle");expect(d).toBeTruthy()});it("reads and sets the 'reversed' option properly",function(){var d=true,e=10;b=$("#testSlider1").slider({reversed:d});b.slider("setValue",e);var c=$("#testSlider1").siblings("div.slider-track").children("div.slider-selection").width();expect(c).toBe(0)});it("reads and sets the 'formater' option properly",function(){var c=function(e){return"Current value: "+e};b=$("#testSlider1").slider({formater:c});b.slider("setValue",9);var d=$("#testSlider1").siblings("div.tooltip").children("div.tooltip-inner").text();expect(d).toBe("Current value: 9")});it("reads and sets the 'enabled' option properly",function(){b=$("#testSlider1").slider({enabled:false});var c=b.slider("isEnabled");expect(c).not.toBeTruthy()});describe("reads and sets the 'tooltip' option properly",function(){it("tooltip is not shown if set to 'hide'",function(){b=$("#testSlider1").slider({tooltip:"hide"});var c=$("#testSlider1").siblings("div.tooltip").hasClass("hide");expect(c).toBeTruthy()});it("tooltip is shown during sliding if set to 'show'",function(){b=$("#testSlider1").slider({tooltip:"show"});var c=!($("#testSlider1").siblings("div.tooltip").hasClass("in"));expect(c).toBeTruthy();$("#testSlider1").trigger("mouseenter");var d=$("#testSlider1").siblings("div.tooltip").hasClass("in");expect(d).toBeTruthy()});it("tooltip is always shown if set to 'always'",function(){b=$("#testSlider1").slider({tooltip:"always"});var c=$("#testSlider1").siblings("div.tooltip").hasClass("in");expect(c).toBeTruthy()});it("defaults to 'show' option if invalid value is passed",function(){b=$("#testSlider1").slider({tooltip:"invalid option value"});var c=!($("#testSlider1").siblings("div.tooltip").hasClass("in"));expect(c).toBeTruthy();$("#testSlider1").trigger("mouseenter");var d=$("#testSlider1").siblings("div.tooltip").hasClass("in");expect(d).toBeTruthy()})})});describe("'setValue()' tests",function(){var c=function(d){return"Invalid input value '"+d+"' passed in"};describe("if slider is a single value slider",function(){beforeEach(function(){b=$("#testSlider1").slider()});it("properly sets the value of the slider when given a numeric value",function(){var d=5;b.slider("setValue",d);var e=b.slider("getValue");expect(e).toBe(d)});it("if a value passed in is greater than the max (10), the slider only goes to the max",function(){var f=10,d=f+5;b.slider("setValue",d);var e=b.slider("getValue");expect(e).toBe(f)});it("if a value passed in is less than the min (0), the slider only goes to the min",function(){var e=0,d=e-5;b.slider("setValue",d);var f=b.slider("getValue");expect(f).toBe(e)});it("return value is jquery object",function(){var e=8,d=b.slider("setValue",e);expect(d.attr).toBeDefined();expect(d.attr("id")).toBe("testSlider1")});describe("when an invalid value type is passed in",function(){var d;beforeEach(function(){d="a"});it("throws an error and does not alter the slider value",function(){var e=b.slider("getValue");var g=function(){b.slider("setValue",d)};expect(g).toThrow(new Error(c(d)));var f=b.slider("getValue");expect(f).toBe(e)})})});describe("if slider is a range slider",function(){beforeEach(function(){b=$("#testSlider1").slider({value:[3,8]})});it("properly sets the values if both within the max and min",function(){var e=[5,7];b.slider("setValue",e);var d=b.slider("getValue");expect(d[0]).toBe(e[0]);expect(d[1]).toBe(e[1])});describe("caps values to the min if they are set to be less than the min",function(){var e=-5,d=7;it("first value is capped to min",function(){b.slider("setValue",[e,d]);var f=b.slider("getValue");expect(f[0]).toBe(0)});it("second value is capped to min",function(){b.slider("setValue",[d,e]);var f=b.slider("getValue");expect(f[1]).toBe(0)})});describe("caps values to the max if they are set to be higher than the max",function(){var e=15,d=7;it("first value is capped to max",function(){b.slider("setValue",[e,d]);var f=b.slider("getValue");expect(f[0]).toBe(10)});it("second value is capped to max",function(){b.slider("setValue",[d,e]);var f=b.slider("getValue");expect(f[1]).toBe(10)})});describe("if either value is of invalid type",function(){var e="a",d=7;it("first value is of invalid type",function(){var f=function(){b.slider("setValue",[e,d])};expect(f).toThrow(new Error(c(e)))});it("second value is of invalid type",function(){var f=function(){b.slider("setValue",[d,e])};expect(f).toThrow(new Error(c(e)))})})});it("throws an error if an element without a 'slider' data property tries to call setValue()",function(){var d=function(){$("#testSlider1").slider("setValue",3)};expect(d).toThrow(new Error(a))});it("if second argument is true, the 'slide' event is triggered",function(){var e=$("#testSlider1").slider({value:3});var d=5;e.on("slide",function(f){expect(d).toEqual(f.value)});e.slider("setValue",d,true)})});describe("'getValue()' tests",function(){it("returns the current value of the slider",function(){b=$("#testSlider1").slider();var c=5;b.slider("setValue",c);var d=b.slider("getValue");expect(d).toBe(c)});it("throws an error if an element without a 'slider' data property tries to call getValue()",function(){var c=function(){$("#testSlider1").slider("getValue")};expect(c).toThrow(new Error(a))})});describe("'destroy()' tests",function(){describe("slider instance tests",function(){beforeEach(function(){b=$("#testSlider1").slider()});it("removes the extra DOM elements associated with a slider",function(){b.slider("destroy");var d=$("#testSlider1").parent("div.slider").length,c=$("#testSlider1").siblings("div.slider-track, div.tooltip").length;expect(d).toBe(0);expect(c).toBe(0)});it("return value is jquery object",function(){var c=b.slider("destroy");expect(c.attr).toBeDefined();expect(c.attr("id")).toBe("testSlider1")});describe("unbinds all slider events",function(){var c,d;beforeEach(function(){c=false});it("unbinds from 'slideStart' event",function(){d="slideStart";b.on(d,function(){c=true});b.slider("destroy");b.trigger(d);expect(c).toBeFalsy()});it("unbinds from 'slide' event",function(){d="slide";b.on(d,function(){c=true});b.slider("destroy");b.trigger(d);expect(c).toBeFalsy()});it("unbinds from 'slideStop' event",function(){d="slideStop";b.on(d,function(){c=true});b.slider("destroy");b.trigger(d);expect(c).toBeFalsy()});it("unbinds from 'slideChange' event",function(){d="slideChange";b.on(d,function(){c=true});b.slider("destroy");b.trigger(d);expect(c).toBeFalsy()})});afterEach(function(){b=null})});it("throws an error if an element without a 'slider' data property tries to call destroy()",function(){var c=function(){$("#testSlider1").slider("destroy")};expect(c).toThrow(new Error(a))})});describe("'enable()' tests",function(){it("correctly enables a slider",function(){b=$("#testSlider1").slider({enabled:false});b.slider("enable");var c=b.slider("isEnabled");expect(c).toBeTruthy()});it("throws an error if an element without a 'slider' data property tries to call enable()",function(){var c=function(){$("#testSlider1").slider("enable")};expect(c).toThrow(new Error(a))});it("return value is jquery object",function(){b=$("#testSlider1").slider({enabled:false});var c=b.slider("enable");expect(c.attr).toBeDefined();expect(c.attr("id")).toBe("testSlider1")})});describe("'disable()' tests",function(){it("correctly disable a slider",function(){b=$("#testSlider1").slider();b.slider("disable");var c=b.slider("isEnabled");expect(c).not.toBeTruthy()});it("throws an error if an element without a 'slider' data property tries to call disable()",function(){var c=function(){$("#testSlider1").slider("disable")};expect(c).toThrow(new Error(a))});it("return value is jquery object",function(){b=$("#testSlider1").slider();var c=b.slider("disable");expect(c.attr).toBeDefined();expect(c.attr("id")).toBe("testSlider1")})});describe("'toggle()' tests",function(){it("correctly enables a disabled slider",function(){b=$("#testSlider1").slider({enabled:false});b.slider("toggle");var c=b.slider("isEnabled");expect(c).toBeTruthy()});it("correctly disables an enabled slider",function(){b=$("#testSlider1").slider();b.slider("toggle");var c=b.slider("isEnabled");expect(c).not.toBeTruthy()});it("throws an error if an element without a 'slider' data property tries to call toggle()",function(){var c=function(){$("#testSlider1").slider("toggle")};expect(c).toThrow(new Error(a))});it("return value is jquery object",function(){b=$("#testSlider1").slider();var c=b.slider("toggle");expect(c.attr).toBeDefined();expect(c.attr("id")).toBe("testSlider1")})});describe("'isEnabled()' tests",function(){it("returns true for an enabled slider",function(){b=$("#testSlider1").slider();var c=b.slider("isEnabled");var d=b.parent().hasClass("slider")&&b.parent().hasClass("slider-disabled");expect(c).toBeTruthy();expect(d).not.toBeTruthy()});it("returns false for a disabled slider",function(){b=$("#testSlider1").slider({enabled:false});var c=b.slider("isEnabled");var d=b.parent().hasClass("slider")&&b.parent().hasClass("slider-disabled");expect(c).not.toBeTruthy();expect(d).toBeTruthy()});it("throws an error if an element without a 'slider' data property tries to call isEnabled()",function(){var c=function(){$("#testSlider1").slider("isEnabled")};expect(c).toThrow(new Error(a))})});it("throws an exception if the user tries to call a non-public method",function(){b=$("#testSlider1").slider();var d="calculateValue";var c=function(){b.slider(d)};expect(c).toThrow(new Error("method '"+d+"()' does not exist for slider."))});it("get attribute",function(){b=$("#testSlider1").slider();var c=b.slider("getAttribute","max");expect(c).toBe(10)});it("changes slider from basic to range",function(){b=$("#makeRangeSlider").slider();b.slider("setAttribute","range",true).slider("refresh");var c=$("#changeOrientationSlider").parent("div.slider").find(".slider-handle").last().hasClass("hide");expect(c).toBeFalsy()});afterEach(function(){if(b){b.slider("destroy");b=null}})});